import React from "react";
import "./WhyManet.css";

// Sample card data
const cardsData = [
  { logo: "https://via.placeholder.com/80", info: "Quality Education" },
  { logo: "https://via.placeholder.com/80", info: "Expert Faculty" },
  { logo: "https://via.placeholder.com/80", info: "Global Exposure" },
  { logo: "https://via.placeholder.com/80", info: "Innovative Learning" },
  { logo: "https://via.placeholder.com/80", info: "Career Support" },
  { logo: "https://via.placeholder.com/80", info: "Community Network" },
];

const WhyManet = () => {
  return (
    <section className="whymanetin-section">
      <h2 className="section-title">Why Choose Manetin</h2>
      <div className="cards-grid">
        {cardsData.map((card, index) => (
          <div key={index} className="why-card">
            <img src={card.logo} alt={`logo-${index}`} className="card-logo" />
            <p className="card-info">{card.info}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default WhyManet;
